import React from 'react';
import TeachersName from '../teachers-name/teachers-name.comp';
import TeachersHoursReport from '../teachers-hours-report/teachers-hours-report.comp';

import './hours-reports.style.css';

const HoursReports = (props) => {

return (
    <div className="hours-reports-container">
        hours reports
        {props.reportsList.map()}

        <br/><br/>

group      date     hour
<br/>
        <TeachersName teacherName="Juan"/>

        <TeachersHoursReport   report={{ 
            group: "UNAL 1",
            date: "02/03/2021",
            numHours: 2, 
         }} />

        <ProductRow   report={{ 
            name: "Ana", 
            grade: 5,
            gender: "female",
         }} />  

        <ProductRow   report={{ 
            name: "Pedro", 
            grade: 0,
            gender: "male",
         }} />  
     <br/>
     <TeachersName teacherName="Ana"/>

        <ProductRow   report={{ 
            name: "Luis", 
            grade: 1,
            gender: "male",
         }} />

        <ProductRow   report={{ 
            name: "Aleja", 
            grade: 2,
            gender: "female",
         }} />  

        <ProductRow   report={{ 
            name: "Kt", 
            grade: 3,
            gender: "female",
         }} />
<br/>
<TeachersName teacherName="luis"/>

        <ProductRow   report={{ 
            name: "Hugo", 
            grade: 1,
            gender: "male",
         }} />

        <ProductRow   report={{ 
            name: "Luisa", 
            grade: 2,
            gender: "female",
         }} />  

        <ProductRow   report={{ 
            name: "Maria", 
            grade: 3,
            gender: "female",
         }} />  
    </div>

);

} 

export default HoursReports;
